Coconut whipped topping:
1 13-14 oz can coconut milk refrigerated overnight in the coldest part of the fridge 
1 tbsp erythitol or sweetener of choice
Splash if vanilla or almond extract.
Ice cold mixing bowl (chill in freezer for a bit)

Open can of coconut milk carefully as it will have seperated from the coconut water... scoop all of the white cream out and leave the coconut water in the can... you will not need the water
Beat cream with hand mixer...mix in extract and sweetener! Thats it...enjoy!

Pudding:
1 pack silken tofu
1/2 cup cocoa powder
1/2 cup erythritol 
1/3 cup almond milk

Mix all ingredients in food processor or blender until creamy and delicious...chill in fridge, top with coconut topping... enjoy guilt free chocolate deliciousness... 

